import React, { useState, useMemo, useEffect, useRef } from 'react';
import { Card, Button, Accordion, Image, Alert } from 'react-bootstrap';
import { ArrowLeft } from 'react-bootstrap-icons';
import 'ol/ol.css';
import Map from 'ol/Map';
import View from 'ol/View';
import TileLayer from 'ol/layer/Tile';
import OSM from 'ol/source/OSM';
import { fromLonLat } from 'ol/proj';
import VectorLayer from 'ol/layer/Vector';
import VectorSource from 'ol/source/Vector';
import Feature from 'ol/Feature';
import Point from 'ol/geom/Point';
import Style from 'ol/style/Style';
import Icon from 'ol/style/Icon';

const EXCLUDED_FIELDS = new Set([
  '_id', 'formhub/uuid', '_xform_id_string', '_uuid', '_attachments',
  '_status', '_geolocation', '_tags', '_notes', '_validation_status',
  '_submitted_by', 'start', 'end', '__version__', 'meta/instanceID',
  '_submission_time','meta/rootUuid', 'meta/deprecatedID'
]);

// Define los grupos según tu estructura en KoboToolbox
const GROUPS = {
  "Información General": ["nombre_subestacion", "ubicacion", "codigo_id", "fecha_reporte", "inspector_responsable"],
  "Transformadores": ["cantidad_transformadores", "tipo_transformador", "potencia_nominal", "tension_primaria", "tension_secundaria", "relacion_transformacion", "temperatura_operacion", "nivel_aceite"],
  "Celdas e Interruptores": ["cantidad_celdas", "tipo_interruptor", "corriente_nominal", "voltaje_operacion", "estado_barras"],
  "Protección y Seguridad": ["tipo_reles_proteccion", "configuracion_disparo", "corriente_disparo", "tiempos_disparo", "estado_baterias"],
  "Puesta a Tierra": ["resistencia_puesta_tierra", "estado_conexiones_tierra"],
  "Enfriamiento y Comunicación": ["tipo_enfriamiento", "estado_ventiladores", "tipo_comunicacion", "estado_comunicacion"],
  "Condiciones Ambientales": ["temperatura_ambiente", "humedad_relativa", "condiciones_climaticas"],
  "Observaciones y Acciones Correctivas": ["observaciones_generales", "acciones_correctivas", "urgencia_accion"]
};

const BackButton = ({ onClick, text }) => (
  <Button variant="link" onClick={onClick} className="text-decoration-none p-0">
    <ArrowLeft /> {text}
  </Button>
);

const renderValue = (key, value) => {
  if (value == null) return 'No respondido';
  return Array.isArray(value) ? value.join(', ') : String(value);
};

const SurveyResponses = ({ surveys, onBack }) => {
  const [view, setView] = useState('summary');
  const [selectedDate, setSelectedDate] = useState(null);

  const groupedResponses = useMemo(() => {
    return surveys.reduce((acc, survey) => {
      const date = new Date(survey._submission_time).toLocaleDateString();
      (acc[date] = acc[date] || []).push(survey);
      return acc;
    }, {});
  }, [surveys]);

  return (
    <div className="container py-4">
      <div className="mb-4">
        <BackButton onClick={onBack} text="Volver a reportes" />
        <h4 className="mt-3">Reporte Subestación</h4>
      </div>
      {view === 'summary' ? (
        <Card className="border-0 shadow-sm">
          <Card.Header className="bg-white d-flex justify-content-between align-items-center">
            <h5 className="mb-0">Resumen de reportes</h5>
            <span className="badge bg-primary">{surveys.length} total</span>
          </Card.Header>
          <Card.Body>
            {Object.entries(groupedResponses).map(([date, responses]) => (
              <div key={date} className="list-group-item">
                <h6>{date} <small className="text-muted">({responses.length} reporte{responses.length !== 1 ? 's' : ''})</small></h6>
                <Button variant="outline-primary" size="sm" onClick={() => { setView('detail'); setSelectedDate(date); }}>Ver reporte</Button>
              </div>
            ))}
          </Card.Body>
        </Card>
      ) : (
        <div>
          <BackButton onClick={() => { setView('summary'); setSelectedDate(null); }} text="Volver al resumen" />
          {groupedResponses[selectedDate]?.map((response, index) => (
            <Card key={index} className="mb-4 border-0 shadow-sm">
              <Card.Header className="bg-primary text-white">
                <h5 className="mb-0">Reporte #{index + 1} - {response.inspector_responsable || "Sin nombre"}</h5>
              </Card.Header>
              <Card.Body>
                <Accordion>
                  {Object.entries(GROUPS).map(([groupName, fields], groupIndex) => {
                    const groupData = fields
                      .map(field => [field, response[field]])
                      .filter(([_, value]) => value !== undefined && !EXCLUDED_FIELDS.has(field));

                    if (groupData.length === 0) return null;

                    return (
                      <Accordion.Item key={groupIndex} eventKey={groupIndex.toString()}>
                        <Accordion.Header>{groupName}</Accordion.Header>
                        <Accordion.Body className="bg-light">
                          {groupData.map(([key, value]) => (
                            <div key={key} className="mb-3 border-bottom pb-3">
                              <div className="fw-medium text-primary mb-2">{key.replace(/_/g, ' ')}</div>
                              <div className="ps-3">{renderValue(key, value)}</div>
                            </div>
                          ))}
                        </Accordion.Body>
                      </Accordion.Item>
                    );
                  })}
                </Accordion>
              </Card.Body>
            </Card>
          ))}
        </div>
      )}
    </div>
  );
};

export default SurveyResponses;
